import './Header.css';
  
export default function Header({ logo, navItems }){
    return (
        <nav className="moe-header">
          <div className="container">
            <a href="/" className="logo">{logo}
            </a>
            <ul className="main-nav">
            {navItems.map((item, index) => (
            <li key={index}>
              <a href={item.href} className="nav-link">
                {item.text}
              </a>
            </li>
          ))}
            </ul>
          </div>
        </nav>
      );
};
